import React from "react";
import { Text, Heading, useColorMode, Divider } from "@chakra-ui/core";
import Card from "../molecules/card";

const Production = () => {
  const { colorMode } = useColorMode();
  return (
    <Card gridArea="1 / 2 / 2 / 3">
      <Heading as="h2" color={`mode.${colorMode}.title`}>
        Production tests
      </Heading>
      <Divider />
      <Text>yo! sldkfjsldjflasjdflsadlkfjlaskjdf</Text>
    </Card>
  );
};

export default Production;
